import React,{Component} from 'react';
import MainImg01 from '../../assets/img/main04.jpg';

class Visul extends Component {
  render() { 
    return (
     
      <div className="main__visual">
        <img src={ MainImg01 } alt="" />
      </div>

    )  
  }
}
export default Visul;
